import Title from '../Title.js'
import Addtodo from './Addtodo.js'
import Todoitem from './Todoitem.js'

const Calendar = () => {
    let example = {
        task: "Study history",
        completed: false
    }
    return (
        <div class='calendar'>
            <Title name="Calendar"/>
            <Addtodo />
            <Todoitem item={example}/>
        </div> 
    )
}

export default Calendar;
